/* eslint-disable jsx-a11y/alt-text */
import { useState, useEffect } from "react";
import "./App.css";
function App() {
  const [data, setData] = useState([]);
  useEffect(() => {
    fetch("http://localhost:8000/data")
      .then((res) => {
        return res.json();
      })
      .then((db) => {
        setData(db.advisorProfileCollection.items);
      });
  }, []);
  return (
    <>
      {data.length>0 &&
        data.map((item,index) => {
          if (item.avatarUrl && item.avatarUrl.url) {
            return <img key={index} src={item.avatarUrl.url}></img>;
          }
        })}
    </>
  );
}

export default App;
